{'id': '13121706', 'text': 'We had a great time staying with Heinz and his wife, under the roof in their flat. We had some interesting talks in the mornings and evenings, about everything, from culture to politics. Sometimes also with some unique background music picked by Heinz. Both Heinz and his wife have a great sense of humor, and have their specific views on life, so it was an enjoyable and stimulating pastime for us. 

We also did a little bit of culinary exchange: Heinz‚Äô wife cooked us one of the best Thai curries we‚Äôve had outside of Thailand (we traveled in Thailand, so we can compare)). Another evening we cooked Ukrainian borsch and potato pancakes, which both turned out tasting really ‚ÄòUkrainian‚Äô. Heinz also gave us some useful advice about our next destination: much appreciated. 

Thank you again for the warm welcome and interesting times together!', 'createdDate': '2013-05-25T19:39:55Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '1433891'}, 'from': {'id': '1692322', 'publicName': 'Irina-Babich-O', 'publicAddress': {'id': '4397444', 'description': 'Kyiv, Kyiv Province, Ukraine'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/1692322/535e95d9-f038-4e38-b6c8-35663a41db34', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

