{'id': '15145937', 'text': 'Dear fellow couchsurfer,

here's what's included in the "Jack Filippini" package:
x an excellent sense of humour and sincere smiles;
x a high level of empathy;
x a genuine interest to hear your story, whoever you are.

Furthermore, Jack is a perfect listener: even if you decide to go into a long monologue about how signs influence people or speak a language that this cosmopolitan is unaware of, he will sit it out! :) Jack will join an Easter egg fight and share a Hare Krishna meal with you. Another + of having him as a guest is that he will readily agree to help you if he can. AND he was able to master the most important phrase in Russian just as quickly! :)

If you need any other reasons to host/meet him, contact me right away!

Jack. you're welcome back! We said good-bye in the middle of a conversation, but what a great memento mori reminder that is... :) Thanks for coming!', 'createdDate': '2014-04-21T20:27:00Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '937918'}, 'from': {'id': '2126540', 'publicName': 'Alex Quartalny', 'publicAddress': {'id': '4831662', 'description': 'Kyiv, Kyiv city, Ukraine'}, 'avatarUrl': 'https://s3.amazonaws.com/ht-images.couchsurfing.com/u/2126540/8DC0B789-7D87-4434-B177-14AEC9FA8079', 'status': 'maybe', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

