{'id': '14771600', 'text': "Short reference: What you need to know, with all my sincerity, is Jeff and his folks are the grandest, most inviting people you'll meet. That's it. That's all.

Longer reference: Jeff and his folks were more than gracious in welcoming me in their busy routine on their working horse stable in Campsie. They're all just awesome in every way. Can't thank them enough for the food, the laughs, more food, and the interesting conversations about Derry through the years. 

Between a rather low-key night at the village pub, to Jeff's masterful tour of the city walls, to our fair share of beers and a lazy days of talking travel and enjoying Take Me Out, SS&SP, and the rest of the UK's finest entertainment, I was glad to toss aside my busy original plans for Derry and just enjoy their company for the weekend. Jeff himself is an awesome guy - easy going, hilarious with a sharp wit, and always up for a good time. I consider him a friend, and look forward to crossing paths again, wherever it will be", 'createdDate': '2014-02-19T00:55:12Z', 'experience': 'positive', 'relationshipType': 'surf', 'isPostTrip': False, 'to': {'id': '3850324'}, 'from': {'id': '612105', 'publicName': 'Nicholas Campiz', 'publicAddress': {'id': '3317228', 'description': 'Kyiv, –ö–∏–µ–≤—Å–∫–∞—è –æ–±–ª–∞—Å—Ç—å, Ukraine'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/43UIECU/10314890_l_15ca0752b6278385f79893f187ec091a.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

{'id': '16976287', 'text': "Hugh came up through Tallahassee just before New Years on his way to New Orleans after spending months in South America. After a quiet few days hanging out here, boom, next thing you know I've joined him on the next leg of his trip. What proceeded was a gloriously random five days knee deep in the bayous of Cajun Country, Louisiana: zydeco dancing with the locals, downing some alligator meat at the local watering hole, a drive-thru spirit or two to wait out the rains, all topped off with a small plane ride above the swamps of the delta. 

Hugh's characteristics make him easy to get along with: he's definitely smart and easy to talk to. He's also open-minded, easy-going and- most importantly - infinitely patient, which make it easy to figure things out, whether we were off to check something out or up for doing nothing at all. 

10/10 Would host/travel with him again.  Won like Oregon that week by having him around. ", 'createdDate': '2015-01-12T22:30:58Z', 'experience': 'positive', 'relationshipType': 'host', 'isPostTrip': False, 'to': {'id': '5323582'}, 'from': {'id': '612105', 'publicName': 'Nicholas Campiz', 'publicAddress': {'id': '3317228', 'description': 'Kyiv, –ö–∏–µ–≤—Å–∫–∞—è –æ–±–ª–∞—Å—Ç—å, Ukraine'}, 'avatarUrl': 'https://s3.amazonaws.com/images.couchsurfing.us/43UIECU/10314890_l_15ca0752b6278385f79893f187ec091a.jpg', 'status': 'yes', 'isVerified': True, 'isDeleted': False, 'blockedBy': None}, 'inverseReference': None, 'response': None}

